  false,\n\t\"url\": null,\n\t\"notes\": \"Monitoring, repair, and replacement of
  fences along the exterior boundaries of Hart Mountain NAR and Sheldon NWR to prevent
  future invasion and re-population of nonnative horses and burros from surrounding
  public and private lands. Friends of Nevada Wilderness to host at least two volunteer
  weekend events, repair at least four of the eight remaining fence deficiencies which
  have been documented along the boundary of Sheldon Refuge and complete monitoring
  and minor repair of no less than 75 miles (1/3) of the exterior boundary fence.\",\n\t\"license_title\":
